Процесс приготовления пищи с газовыми плитами CEZARIS может превратиться в творческое призвание. Ведь газовая плита СEZARIS – это не только долгий срок эксплуатации и доступная цена, но и высокая функциональность. Помимо этого, отечественный производитель бытовых газовых плит торговой марки СEZARIS думая о своих потребителях, позаботился о том, чтобы устройства для приготовления пищи можно было безопасно использовать как в кирпичных домах, так и в блочных многоэтажных постройках. Газовые плиты СEZARIS работают как на сжиженном, так и на природном газе.Преимущества газовых плит CEZARIS
доступная цена при сохранении функциональности;
безопасность эксплуатации;
высокое качество продукции;
удобство пользования;
возможность выбора цветового оформления.

Обратите внимание! 51 см это максимальный размер от всех выступающих частей плиты. По технической документации допускаются отклонения до 2-3 см.Обратите внимание! Крышка не входит в комплект.

